B.Ec=A.a(s(["Cryptocurrency Economics","e.png","tri1.png","tri2.png","The Infinite Economy",B.DS,B.E8,"Representation of\nhow the system is maintained\nwhile infinitely divided","Representation of\nhow unique attributes are preserved\nin an infinite set","Clap on Medium","https://mccossum.medium.com/the-infinite-economy-2ba585b61ddb",4289831540,"What if there was a new economic model that enabled a currency with infinite reach while maintaining a set quantity, providing long-term stability and avoiding inflationary behaviors? With the ability to trade all assets, no matter how low in value, and using a unique combination of fungible and non-fungible attributes, this new currency model has the potential to revolutionize the way we think about money."]),t.b)
B.LK=new A.aM("Cooking should be simple. Most recipes can be simplified down to three things; Ingredients, Temperature, and Time. This is in stark contrast to how recipes are presented online. Many hide behind long stories and intrusive ads. Even after all that I still found many recipes still hard to follow and keep track of my place in.\n\nI started working with a team of good friends to investigate methods of creating a great user experience while following new recipes. We worked on hardware, software, and design to tackle this initiative.",null,B.o,null)
B.Di=A.a(s([B.LK]),t.n)
B.Lq=new A.aM("Starting with the software, we used a robust recipe parser to extract only the most relevant information from online recipes. No stories, no obscure links, only what the user needed to know to make the recipe. Along with this, we designed our screens to focus on minimalism, only showing the user one measurement or instruction at a time. This guaranteed comprehension while maintaining an intuitive flow.\n\nAll of the software paired directly with our custom hardware. To seamlessly connect the digital space to the physical food our team designed a sleek, food-safe, scale. With the aid of this scale, users could navigate through a recipe without the need to know exact amounts. All they have to focus on is if they need to add more or less of each ingredient to the scale. This allowed recipes to auto-advance on the phone once each ingredient was correct. This intuitive pairing allowed room for a level of simplicity in recipes that was previously unheard of.\n\nAll this is wrapped up in a design language that spans across both software and hardware. The scale easily pairs with our kitchenware and bowls to automatically detect and calibrate the added weight. Our unique stamped logo guarantees grip and stability of app parts leading to fewer messes compared to other scales. Even if there is a mess, our scale is one of the few covered in dishwasher safe parts allowing for easy cleanup. This elegant design is reflected in the app as colors automatically change to match the user's kitchenware set and allow them to quickly jump into recipes with similar recipes to those made in the past.\n\nThis project is still in development by the team and does not have an official launch date as of this time. Our team is working diligently to ensure the success of the Banana Scale with over 10,000 recipes. Please allow notifications to hear about this project as it progresses.",null,B.o,null)
B.CM=A.a(s([B.Lq]),t.n)
B.Cp=A.a(s(["Preparing Food","rethinkrecipes.png","rr1.png","rr2.png","Banana Scale",B.Di,B.CM,"Starting a recipe","Minimalist instructions","","",4293878608,"Tired of sifting through long and intrusive online recipe stories just to find the information you need? Look no further than the Banana Scale, a revolutionary kitchen tool designed to simplify your cooking experience. With a focus on minimalism and intuitive design, this custom hardware and software pairing allows you to effortlessly navigate through recipes, leaving you with more time to focus on what really matters - the food."]),t.b)
B.LI=new A.aM("Our interaction with the air around us is often taken for granted. Though the air we breathe is a constant shaping force in our lives we rarely think about how it changes with our environment. As we go throughout our day in different locations for both indoor and outdoor settings the composition of our air can vary greatly.\n\nAround 60 years ago Carbon Dioxide (CO2) concentrations were around 300 parts per million (ppm). Currently, in a natural environment, CO2 levels average about 415ppm. With this sudden change taking us 35% over the historical average and still growing, we are entering unprecedented territory.\n\nThis situation only gets more bleak when we look into unnatural environments. Office buildings and other crowded gathering spaces can have CO2 levels ranging from several hundred ppm to over 1000 ppm. This is still under common safety guidelines warning of levels of 5000ppm and above, but recent studies have shown there still may be reason for concern. At 1000ppm there is a 15% decrease in cognitive function going up to 50% at 1400ppm. If we care about our ability to think, either as an individual or a species, this issue needs to be addressed.\n\nOn a small scale, plants may be an option to curb high CO2 levels. It takes about 7-8 mature trees per person to exchange all the air we breathe. While trees are a vital part of our ecosystem they are certainly not the most efficient to manage CO2 levels, nor are they practical in an indoor setting. With the aid of selective breeding, we may be able to create super oxygenating plants and algae to curb indoor CO2 levels.",null,B.o,null)
B.DR=A.a(s([B.LI]),t.n)
B.LG=new A.aM("To test the hypothesis that I could breed better oxygenating species of algae and plants I started with 64 Fast Plants from the University of Wisconsin. These are a type of mustard seed with a total lifecycle of around 60 days. This would allow me to isolate leaves from mature plants and only germinate seeds from plants with the highest oxygen-producing levels per leaf mass. Over many generations, I expect to see a trend of higher oxygen-producing varieties.\n\nI have also started reproducing this experiment with Chlorella vulgaris, a type of algae, in a series of small bioreactors. This plans to be beneficial for the faster reproductive cycle leading to faster selection and evolution times. Also, it goes to say, the series of 12 green glowing bioreactors just look extremely cool. I could easily imagine these lining a sci-fi-looking spaceship in the future able to supply future generations with clean air and nutrients.\n\nThe experiment with Wisconsin Fast Plants is still ongoing and has not yet shown results, the same goes for the Chlorella vulgaris group. I do not expect to see significant changes till the 30th generation at earliest. I will work on posting updates as this unfolds so please sign up for notifications. This is a slow project but one that would leave behind a more efficient method for clean air in the future.",null,B.o,null)
B.DO=A.a(s([B.LG]),t.n)
B.Eb=A.a(s(["Oxygen","o2.png","o22.png","o23.png","Selective Breeding for Better O2 Production",B.DR,B.DO,"Test of an Algae Bioreactor","Grid of FastPlants Growing","","",4282085435,"Take a deep breath. The air we breathe has a direct impact on our cognitive function. With carbon dioxide levels increasing at an unprecedented rate, can we selectively breed plants & algae to curb indoor CO2 levels and ensure future generations have access to healthy air?"]),t.b)
